function reducePolymers(input) {
  let size = input.length;
  let string = input;
  let uniqLetters = new Set();
  string.split("").forEach(element => {
    uniqLetters.add(element.toUpperCase());
  });

  let smallest = input.length;
  uniqLetters.forEach(letter => {
    let shortened = true; // first pass

    let removedString = string
      .split(letter.toLowerCase())
      .join("")
      .split(letter.toUpperCase())
      .join("");
    // console.log(letter + " " + removedString);

    while (shortened) {
      // one iteration to remove dups
      let reactedString = react(removedString);
      shortened = removedString.length > reactedString.length;
      removedString = reactedString;
    }
    // console.log(letter + " " + removedString.length);
    if (removedString.length < smallest) smallest = removedString.length;
  });

  console.log(smallest);
}

function react(string) {
  let array = string.split("");

  for (let i = 0; i < array.length - 1; i++) {
    const first = array[i];
    const second = array[i + 1];

    if (pairCanReact(first, second)) {
      array[i] = "-";
      array[i + 1] = "-";
    }
  }
  return array.join("").replace(/-/gi, "");
}

function pairCanReact(first, second) {
  return (
    first.toUpperCase() === second.toUpperCase() &&
    ((/[a-z]/.test(first) && /[A-Z]/.test(second)) ||
      (/[a-z]/.test(second) && /[A-Z]/.test(first)))
  );
}

reducePolymers(challengeInput);
